import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
} from './NavbarDesign';

function logo() {
  return (
    <img src="../images/logo_blanc.png" alt="My Image" />
  );
}
  
const Navbar = () => {

  
  return (
    <>
      <Nav>
        <Bars />

        <logo/>

        <NavMenu>
          <NavLink to='/home'>
            ACCUEIL
          </NavLink>
          <NavLink to='/carte'>
            CARTE
          </NavLink>
          <NavLink to='/infos'>
            INFORMATIONS
          </NavLink>
          
        </NavMenu>
        
      </Nav>
    </>
  );
};

export default Navbar;
